import { useState } from 'react'
const videos = [
	{
		name: 'Назва відео 1',
		duration: 15,
		id: 1,
	},
]

export function Home() {
	const [count, setCount] = useState(0)
	return (
		<main>
			{videos.map(video => {
				return (
					<div key={video.id}>
						<img alt='' />
						<p>{video.name}</p>
						<p>{video.duration}</p>
						<button onClick={() => setCount(count => count + 1)}>button</button>
						<p>{count}</p>
					</div>
				)
			})}
		</main>
	)
}
